CREATE DEFINER=`root`@`%` PROCEDURE `proc_truncate_cqc_CalcResult`(
  IN RecordID__ INTEGER         -- 消除指定CQC算量结果表用的 RecordID
)
LABEL: BEGIN
  -- AUTHOR: bySHIFT
  -- Routine body goes here...
  DECLARE ModelDBName VARCHAR(64);
  DECLARE ProjectName VARCHAR(64);
  DECLARE TruncateTable_SQL VARCHAR(128);
  DECLARE TruncateTablePostfixName VARCHAR(8);

  -- 遍历数据结束标志
  DECLARE done INT DEFAULT FALSE;

  -- 游标
  DECLARE cur CURSOR FOR SELECT PostfixName FROM TB_TEMP_TruncateTablePostfix;

  -- 将结束标志绑定到游标
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

  SELECT B.ModelDBName, P.Name INTO ModelDBName, ProjectName
  FROM BIMMODEL AS B, PROJECT AS P
  WHERE B.RecordID = RecordID__ AND P.RecordID = B.ProjectID;

  IF ((ModelDBName IS NULL) OR (CHAR_LENGTH(ModelDBName) < 4)) THEN
    SELECT '未找到指定 RecordID 的CQC算量结果表' AS '状态';
    LEAVE LABEL;
  END IF;

  CREATE TEMPORARY TABLE IF NOT EXISTS TB_TEMP_TruncateTablePostfix (
    PostfixName VARCHAR(8)
  ) ENGINE = MEMORY;

  TRUNCATE TABLE TB_TEMP_TruncateTablePostfix;
  INSERT INTO TB_TEMP_TruncateTablePostfix VALUES(''), ('-psi');

  -- 打开游标
  OPEN cur;

  -- 开始循环
  read_loop: LOOP
    -- 提取游标里的数据
    FETCH cur INTO TruncateTablePostfixName;

    -- 声明结束的时候
    IF done THEN
      LEAVE read_loop;
    END IF;

    -- 这里做你想做的循环的事件
    SET TruncateTable_SQL = CONCAT('TRUNCATE TABLE hgdataserver.`', ModelDBName, TruncateTablePostfixName, '`;');
    SELECT TruncateTable_SQL INTO @TruncateTable_SQL;
    BEGIN
      PREPARE TruncateTable_SQL FROM @TruncateTable_SQL;
      EXECUTE TruncateTable_SQL;
      SELECT ProjectName, TruncateTable_SQL, '成功' AS '状态';
    END;
  END LOOP;

  -- 关闭游标
  CLOSE cur;
  DROP TABLE TB_TEMP_TruncateTablePostfix;
END ;;
